        private string Request = string.Empty;
        private XDocument XMLRequest = null;
        private void Init()
        {
            var content = new byte[HttpContext.Current.Request.InputStream.Length];
            HttpContext.Current.Request.InputStream.Read(content, 0, content.Length);
            Request = Encoding.UTF8.GetString(content);
            //XMLRequest = new XDocument(new StringReader(Request));
            HttpContext.Current.Response.ContentType = HttpContext.Current.Request.ContentType;
        }
        private string GetValueStringFromParent(string NodeRoot, string NodeSearched)
        {
            return XMLRequest.Root.Element(NodeRoot).Element(NodeSearched).Value;
        }
        private string GetValueStringFromNode(string Node)
        {
            var node = XMLRequest.Descendants().Where(n => n.Name == Node).FirstOrDefault();
            return node != null ? node.Value : string.Empty;
        }
        private void SetResponse(string content)
        {
            HttpContext.Current.Response.Write(content);
        }


        private readonly string ConfigFile = AppDomain.CurrentDomain.BaseDirectory + @"Configuration\Config.xml";

        [WebMethod]
        [ScriptMethod(UseHttpGet = true)]
        public void MockWs(string service)
        {
            if (!File.Exists(ConfigFile))
            {
                throw new FileNotFoundException("El archivo de configuracion no existe");
            }
            var config = Deserialize<ConfigRoutes>(XDocument.Load(ConfigFile).ToString())
                .DinamycMock.Where(m => string.CompareOrdinal(service, m.PartialPath) == 0);
            if (config.Any())
            {
                var currentConf = config.First();
                if (!File.Exists(AppDomain.CurrentDomain.BaseDirectory + currentConf))
                {
                    throw new FileNotFoundException("El archivo de configuracion no existe");
                }
            }
            else
                throw new InvalidOperationException("No existe condiguracion para el servicio solicitado");

        }

        private static T Deserialize<T>(string data) where T : class
        {
            using (var ms = new MemoryStream(Encoding.UTF8.GetBytes(data)))
            {
                var serializer = new XmlSerializer(typeof(T));
                return (T)serializer.Deserialize(ms);
            }
        }
